import { Box , Card, CardMedia, Typography  } from '@mui/material'
import React from 'react'
import CityData from '../../Assets/Data/CityData'
import Slider from "react-slick";
import { makeStyles } from '@material-ui/styles'

const imagestyle= makeStyles({
    projectCard:{
        border: '1px solid rgb(229, 229, 229)',
        boxShadow:'none !important',
        height:'150px !important',
      width:'95% !important',
       
        "&:hover":{boxShadow:'rgb(0 0 0 / 15%) 0px 6px 12px 0px !important' ,
         cursor:'pointer'
    }
     }
})

const City = () => {

    const cardimage = imagestyle();
    var settings = {
        dots: true,
        infinite: false,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        initialSlide: 0,
        responsive: [
          {
            breakpoint: 1024,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 3,
              infinite: true,
              dots: true
            }
          },
          {
            breakpoint: 600,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 2,
              initialSlide: 2
            }
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1
            }
          }
        ]
      };

      
  return (
    <Box pt={3} p={3}  mt={3}>
         <Typography variant='h5' component='div' fontWeight={600}>
        Our Cities Collection
         </Typography>
        <Typography variant='subtitle2' color='#747474'>
            Most sought-after projects in Thane
        </Typography>
         <Box mt={2}>
         <Slider {...settings}>
            {CityData.map((item)=> (
                 <Card className={cardimage.projectCard}>
                 <CardMedia 
                  component='img'
                  image={item.city_image}
                 
                  sx={{borderRadius:'20px'}}

                 />
             </Card>

            ))}
           
         </Slider> 
         </Box>
          



        
    </Box>
  )
}

export default City
